The regex /\d+/ matches one or more consecutive digits in the string. The match() method returns an array containing the first match found. By accessing match[0] , you get the first set of numbers from the string. can you make it so it only matches the first set of numbers? The current regex already matches only the first set of numbers. The match() method returns the first match it finds in the string.

If you want to ensure that it only matches numbers at the start of the string, you can use the ^ anchor:
```
const str = "123hello456world";
const regex = /^\d+/;
const match = str.match(regex);
console.log(match[0]); // Output: "123"
